import React from "react";
import data from "./data";
import Mem from "./Mem";

function Hot() {
  const hots = data.filter((mem) => mem.upvotes - mem.downvotes > 5);

  const memes = hots.map((mem) => {
    return <Mem key={mem.id} mem={mem} />;
  });
  return (
    <div>
      <p>Hot!</p>
      {memes}
    </div>
  );
}

export default Hot;
